def display_seconds(seconds: int, granularity: int = 1):


    intervals = {
        "hours": 3600,
        "minutes": 60,
        "seconds": 1,
    }
    result = []

    for name in intervals:
        count = intervals[name]
        value = seconds // count
        if value:
            seconds -= value * count
            if value == 1:
                name = name[:-1]
            result.append(f"{value} {name}")
    return ", ".join(result[:granularity])

