def merge(left_array, right_array):

    i, j = 0, 0
    result = []
    while True:
        if i >= len(left_array):
            result.extend(right_array[j:])
            break
        if j >= len(right_array):
            result.extend(left_array[i:])
            break
        if left_array[i] <= right_array[j]:
            result.append(left_array[i])
            i += 1
        else:
            result.append(right_array[j])
            j += 1
    return result

