def binary_search(array, item):


  low = 0
  high = len(array) - 1


  while low <= high:

    mid_point = (low + high) // 2

    guess = array[mid_point] # make the guess

    if guess == item:
      return mid_point

    if guess > item:
      high = mid_point - 1

    else:
      low = mid_point + 1


  return 'item not found in the array'

def conv_out_size(i, p, k, s):

    # convert p to a number
    if p == 'SAME':
        p = k // 2
    elif p == 'VALID':
