def get_neighbours(cell, h, w):

    x = cell[0]
    y = cell[1]
    north = south = east = west = None
    if y + 1 < h:
        north = (x, y + 1)
    if y - 1 > 0:
        south = (x, y - 1)
    if x + 1 < w:
        east = (x + 1, y)
    if x - 1 > 0:
        west = (x - 1, y)

    return [north, south, east, west]

