def optimize_bit_format(bits_size):

    if bits_size >= (1 << 31):
        fmt_code, std_size = 'Q', 8 # unsigned long long
    elif bits_size >= (1 << 15):
        fmt_code, std_size = 'I', 4 # long
    else:
        fmt_code, std_size = 'H', 2 # unsigned short
    return (fmt_code, std_size)

def top(rect):

    return max(
        rect[0][1],
        rect[0][1] + rect[1][1]
       )

def fast_modular_multiply(g, k, p):

    u = g
    y = 1
    while k != 0:
        if k % 2 == 1:
            y = y * u % p
        u = u * u % p
        k //= 2
    return y

def binary_search(seq, f, target):

    if not seq or f(seq[0]) > target:
        return 0
    elif f(seq[-1]) < target:
        return len(seq)
    upper = len(seq)
    lower = 0
    while (upper - lower) > 1:
        current = (upper + lower) // 2
        next_val = f(seq[current])
        if next_val > target:
            upper = current
        elif next_val <= target:
            lower = current
    return upper

def get_human_readable_size(size, precision=0):

    suffixes = ['o', 'Ko', 'Mo', 'Go', 'To']
    suffix_index = 0
    while size > 1024 and suffix_index < 4:
        suffix_index += 1  # increment the index of the suffix
        size = size/1024.0  # apply the division
    return "%.*f %s" % (precision, size, suffixes[suffix_index])

def LargestPrimeFactor(num):

    p_factor = 1
    i = 2

    while i <= num / i:
        if num % i == 0:
            p_factor = i
            num /= i
        else:
            i += 1

    if p_factor < num:
        p_factor = num

    return p_factor

