def is_numeric(value=''):

    if isinstance(value, str):
        try:
            float(value) if '.' in value else int(value)
        except ValueError:
            return False

    return True

def size_similarity(heights, index1, index2):

    h1 = heights[index1]
    h2 = heights[index2]
    return min(h1, h2) / max(h1, h2)

def threshold_cell_line_np(np_C, np_X, np_Y, cell_line, more_than, less_than=None):

    m1 = np_Y[:, :, cell_line].max(axis=1) > more_than
    if less_than:
        m2 = np_Y[:, :, cell_line].max(axis=1) < less_than
        threshold_mask = (m1 & m2)
    else:
        threshold_mask = m1
    thresholded_X = np_X[threshold_mask]
    thresholded_C = np_C[threshold_mask]
    thresholded_Y = np_Y[threshold_mask, :, cell_line]
    return (thresholded_C, thresholded_X, thresholded_Y)

def is_adjacent(pos1, pos2):

    return (pos1[0] == pos2[0] and abs(pos1[1] - pos2[1]) == 1 or
        pos1[1] == pos2[1] and abs(pos1[0] - pos2[0]) == 1)

def words_and_tags_from_wsj_tree(tree_string):

  stack, tags, words = [], [], []
  for tok in tree_string.strip().split():
    if tok[0] == "(":
      symbol = tok[1:]
      tags.append(symbol)
      stack.append(symbol)
    else:
      assert tok[-1] == ")"
      stack.pop()  # Pop the POS-tag.
      while tok[-2] == ")":
        tags.append("/" + stack.pop())
        tok = tok[:-1]
      words.append(tok[:-1])
  return str.join(" ", words), str.join(" ", tags[1:-1])  # Strip "TOP" tag.

def center_of_mass(x, m=None):

    if m is None:
        return x.mean(0)
    else:
        from numpy import dot

        return dot(m, x) / m.sum()

def nbai(b6, b11):


    NDBaI = (b6 - b11) / (b6 + b11)
    return NDBaI

def rotate_left(x, y):

    if len(x) == 0:
        return x
    y = y % len(x)
    return x[y:] + x[:y]

