def word_score(word):


    num_letters = len(word)

    if num_letters < 3:
        return 0
    elif num_letters <= 6:
        return num_letters
    elif num_letters > 12:
        return 3 * num_letters
    else:
        return ((num_letters - 1) // 3) * num_letters

