def num2eng(num, k=1024):

    if num > k ** 5:
        numstr = "%.1fP" % (float(num) / k ** 5)
    elif num > k ** 4:
        numstr = "%.1fT" % (float(num) / k ** 4)
    elif num > k ** 3:
        numstr = "%.1fG" % (float(num) / k ** 3)
    elif num > k ** 2:
        numstr = "%.1fM" % (float(num) / k ** 2)
    elif num > k:
        numstr = "%.1fk" % (float(num) / k)
    else:
        numstr = "%.1g" % (float(num))
    return numstr

