def coding_problem_30(arr):

    water = 0
    while len(arr) > 2:

        lval = arr[0]  # the idea is: from the smallest left/right boundary, accumulate water level until reaching a
        rval = arr[-1]  # higher wall inside. Then recurse with with the new bound, until only two array entries.
        if lval <= rval:

            cnt = 1
            while arr[cnt] < arr[0]:
                water += arr[0] - arr[cnt]
                cnt += 1

            arr = arr[cnt:]

        else:

            cnt = -2
            while arr[cnt] < arr[-1]:
                water += arr[-1] - arr[cnt]
                cnt -= 1

            arr = arr[:cnt+1]

    return water

def weighted_average(group, avg_name, weight_name):

    d = group[avg_name]
    w = group[weight_name]
    try:
        return (d * w).sum() / w.sum()
    except ZeroDivisionError:
        return d.mean()

def add_tolerance(box, im_shape, tols):

    h, w, d = im_shape
    [h_min, h_max, w_min, w_max, d_min, d_max] = box
    h_min = h_min - tols[0]
    h_max = h_max + tols[1]
    w_min = w_min - tols[2]
    w_max = w_max + tols[3]
    d_min = d_min - tols[4]
    d_max = d_max + tols[5]
    if h_min < 0:
        h_min = 0
    if h_max > h:
        h_max = h
    if w_min < 0:
        w_min = 0
    if w_max > w:
        w_max = w
    if d_min < 0:
        d_min = 0
    if d_max > d:
        d_max = d

    return h_min, h_max, w_min, w_max, d_min, d_max

