    if use_abs:
        df = trait_vector.abs()
    else:
        df = trait_vector

    trait_top_genes = df.sort_values(ascending=False).head(n_top).index

    trait_vector = trait_vector.copy()
    trait_vector[~trait_vector.index.isin(trait_top_genes)] = 0.0

